<template>
  <div id="app" style="text-align: center;width: 90%; margin: auto">

    <div id="main" style="width: 900px;height:600px;margin:0 auto">
      <!--<h3>技能树</h3>-->
    </div>
  </div>
</template>
<script>
require('echarts-wordcloud')
export default {
  name: 'skill_tree_wordCloud',
  data() {
    return {
      datas: []
    }
  },
  methods: {
    requestData() {
      let _this = this;
      this.$axios({
        method: 'get',
        url: 'http://localhost:9000/data/allSkills'
      }).then(function (re) {
        _this.datas = re.data;
        _this.showWords()
      })
    },
    showWords() {
      let myChart = this.$echarts.init(document.getElementById('main'))
      var symbolUrl = 'data:image/jpeg;base64,'
      // var symbolUrl ='data:image/png;base64,'
      //  var symbolUrl = 'data:image/jpeg;base64,'


      var data = this.datas
      // for (let i = 0; i < presents.length; ++i) {
      //   data.push({
      //     name: presents[i],
      //     value: (presents.length - i) * 20
      //   })
      // }
      // for (let i = 10; i < presents.length; ++i) {
      //   var cnt = Math.floor(Math.random() * 10)
      //   for (var j = 0; j < cnt; ++j) {
      //     data.push({
      //       name: presents[i],
      //       value: Math.random() * 10
      //     })
      //   }
      // }

      var maskImage = new Image()
      // maskImage.
      // maskImage.width = 100
      // maskImage.height = 180
      maskImage.onload = function () {
        myChart.setOption({
          tooltip: {
            show: true,
            position: 'top',
            textStyle: {
              fontSize: 30
            }
          },
          grid: {
            left: 0,
            bottom: 0,
            top: 0,
            right: 0,
          },
          xAxis: {
            type: 'category',
            show: false
          },
          yAxis: {
            max: 100,
            show: false
          },
          series: [{
            type: 'wordCloud',
            sizeRange: [15, 60],
            rotationRange: [-50, 50],
            maskImage: maskImage,
            textPadding: 0,
            gridSize: 5,
            width: '100%',
            height: '100%',
            left: 'center',
            top: 'center',
            drawOutOfBound: false,
            textStyle: {
              normal: {
                color: function () {
                  return 'rgb(' + [
                    Math.round(Math.random() * 160),
                    Math.round(Math.random() * 160),
                    Math.round(Math.random() * 160)
                  ].join(',') + ')'
                }
              },
            },
            data: data
          },]
        })
      }
      myChart.on('dblclick', function (params) {
        for(let i=0;i < data.length;i++){
          if(data[i].name === params.data.name){
            data.splice(i,1)
            myChart.setOption({
              // backgroundColor: '#012248',
              tooltip: {
                show: true,
                position: 'top',
                textStyle: {
                  fontSize: 30
                }
              },
              grid: {
                left: 0,
                bottom: 0,
                top: 0,
                right: 0,
              },
              xAxis: {
                type: 'category',
                show: false
              },
              yAxis: {
                max: 100,
                show: false
              },
              series: [{
                type: 'wordCloud',
                gridSize: 5,
                sizeRange: [20, 50],
                rotationRange: [-50, 50],
                // rotationStep: 45,
                // shape: 'circle',
                left: 'center',
                top: 'center',
                maskImage: maskImage,
                width: '90%',
                height: '90%',
                drawOutOfBound: false,
                textStyle: {
                  normal: {
                    color: function () {
                      return (
                          'rgb(' + [
                            Math.round(Math.random() * 500),
                            Math.round(Math.random() * 300),
                            Math.round(Math.random() * 200)
                          ].join(',') +
                          ')'
                      )
                    }
                  },
                  emphasis: {
                    shadowBlur: 10,
                    shadowColor: '#ffffff'
                  }
                },
                data: data
              }]
            })
            break
          }
        }
      })
      maskImage.src = symbolUrl

    }
  },
  mounted() {
    this.requestData()
  }
}
</script>

